/* eslint-disable import/no-anonymous-default-export */
import React, { useRef } from "react";
import './log.css';
export default ()=>{
    const usr=useRef(null)
    const pass=useRef(null)

    const submit = ()=>{
        if (usr.current.value === 'root' && pass.current.value === 'root') {
            sessionStorage.setItem('log','123')
        }

    }
    return(
        <div className="login">
        <form action="POST" onSubmit={submit}>
          <h1 className="tit" >login</h1>
          <br />
          <label htmlFor="una">username</label><br />
          <div>
            <span className="una" ></span><input ref={usr} id="una" placeholder="username.."  required/><br />
          </div>
          <br />
          <label htmlFor="una">password</label><br />
          <div>
            <span className="pass" ></span><input ref={pass} id="pass" placeholder="password.." required/><br />
          </div>
          <div className="fogpass">
            <button>forgot password?</button>
          </div>
          <button type="submit">login</button><br />
          <button type="reset" >reset</button><br />
        </form>
      </div>
    )
}
